import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Spinner } from 'react-bootstrap';

function App() {
  return (
    <Container style={{height:'100vh', width: "100%", display: 'flex', justifyContent:'center', flexWrap: 'wrap', alignContent:'center'}}>
      <Spinner animation="border" variant="info" />
    </Container>
  );
}

export default App;
